import { useTheme } from "../../theme";
import AddStudentForm from "../../components/admin/users/students/AddStudentForm";


const svgStringUFSM = `<svg width="1993" height="1993" viewBox="0 0 1993 1993" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="1993" height="1993" fill="url(#pattern0_6135_236)"/>
<defs>
<pattern id="pattern0_6135_236" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_6135_236" transform="scale(0.000501756)"/>
</pattern>
<image id="image0_6135_236" width="1993" height="1993" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`;

const svgStringBatista = `<svg width="4002" height="2250" viewBox="0 0 4002 2250" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect x="0.5" width="4001" height="2250" fill="url(#pattern0_6135_234)"/>
<defs>
<pattern id="pattern0_6135_234" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_6135_234" transform="scale(0.000249938 0.000444444)"/>
</pattern>
<image id="image0_6135_234" width="4001" height="2250" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
`;

const base64SvgUFSM = `data:image/svg+xml;base64,${btoa(svgStringUFSM)}`;

const base64SvgBatista = `data:image/svg+xml;base64,${btoa(svgStringBatista)}`;


export const LoginPage = () => {
    const theme = useTheme();
    const navigate = useNavigate();

    const handleLogin = (loggedInUser: LoginResponse) => {
        setStorage(loggedInUser);
        const isAdmin = adminVerify();
        navigate(isAdmin ? `${PATHS.ADMIN}/${PATHS.DATA}` : `${PATHS.LEVELS}`);

        // eslint-disable-next-line no-restricted-globals
        location.reload();
    };

    const handleAccessInstructions = () => {
        navigate(`${PATHS.ACCESS_INSTRUCTIONS}`);

        // eslint-disable-next-line no-restricted-globals
        location.reload();
    };

    return (
        <DadinhoStack p={1} maxWidth="500px" minWidth="500px" height="100vh" justifyContent={"space-between"} sx={{ 
            [theme.breakpoints.down('md')]: {
                minWidth: "300px",
              },
        }}>
            <DadinhoHeader isMainPage displayLogoName />
            <DadinhoStack direction="column" spacing={2}>
                <Login onLoginSuccess={handleLogin} />
                <DadinhoLink onClick={handleAccessInstructions} underline="none" textAlign="center">Como conseguir acesso?</DadinhoLink>
            </DadinhoStack>
            <DadinhoBox border="2px solid" borderRadius="10px" p={1.5} sx={{ 
                    [theme.breakpoints.down('md')]: {
                        display: "none",
                    },
            }}>
                <DadinhoStack direction="row" alignItems="center" justifyContent="space-between" sx={{ 
                    [theme.breakpoints.down('md')]: {
                        flexDirection: "column",
                    },
                }}>  
                    <DadinhoStack direction="row">
                        <DadinhoBox
                            sx={{
                                position: 'relative',
                                top: 0,
                                left: 0,
                                minWidth: "80px",
                                height: '80px',
                                backgroundImage: `url(${base64SvgUFSM})`,
                                backgroundSize: 'contain',
                                backgroundRepeat: 'no-repeat',
                                backgroundPosition: 'center',
                                zIndex: 1, 
                            }}
                        />
                        <DadinhoBox
                            sx={{
                                position: 'relative',
                                top: 0,
                                left: 0,
                                minWidth: "80px",
                                height: '80px',
                                backgroundImage: `url(${base64SvgBatista})`,
                                backgroundSize: 'contain',
                                backgroundRepeat: 'no-repeat',
                                backgroundPosition: 'center',
                                zIndex: 1, 
                            }}
                        />
                    </DadinhoStack>
                    <DadinhoDivider 
                        orientation="vertical" 
                        sx={{ 
                            border: "1px solid black", 
                            height: "80px", 
                            [theme.breakpoints.down('md')]: {
                                display: "none",
                            }
                        }}
                    />
                    <DadinhoTypography 
                        variant="body2" 
                        textAlign="left" 
                        sx={{ 
                            textAlign: "center",
                        }}
                    >
                        Este jogo é uma parceria entre<br/> UFSM e Colégio Batista. <br/><br/>Divirta-se!
                    </DadinhoTypography>
                </DadinhoStack>
            </DadinhoBox>
            <DadinhoFooter />
        </DadinhoStack>
    );
}

export default LoginPage;